import React from 'react'
import './RowPost.css'
function RowPost() {
  return (
    <div className='row'>
        <h2 className="title">Title</h2>
        <div className="posters">
            <img src="https://i.pinimg.com/564x/79/46/ee/7946ee22b1e06736b3bf5cff6890a7b7.jpg" alt="" />
        </div>
    </div>
  )
}

export default RowPost
